import './css/App.css'
import './css/colors.css'
import Navbar from './navbar'

function App() {
    return (
        <div className="App">
            <Navbar />
            <div id="content">
                Bienvenue sur ARE, merci d'utiliser la barre de navigation pour choisir
            </div>
        </div>
    );
}

export default App;
